import React, { Component } from "react";
import GoogleMapReact from "google-map-react";
import { withGoogleMap, GoogleMap, Marker,InfoWindow } from "google-map-react";
import Geolocation from "react-geolocation";


const AnyReactComponent = ({ text }) => <div>{text}</div>;

export default class Map extends Component {

  constructor(props) {
    super(props);

    this.state = {
        center: { lat: 40.744679, lng: -73.948542 },
        zoom: 4.5
      };
    console.log(props)
  }

  geoSuccess = async () => {
    let coords = {
      lat: parseFloat(this.props.latitude),
      lng: parseFloat(this.props.longitude)
    }
    await this.setState({
      center: coords
    })
    console.log(this.state)
  };

  render() {
    return (
        <>
      <div
        className="google-map"
        style={{ height: "80vh", width: "100%" }}
        >
        <button onClick={this.geoSuccess}>Get Position</button>

        <GoogleMapReact

            bootstrapURLKeys={{
                key: 'AIzaSyDZ6LLCf_H_2jGMjh3oxB75j-lhUUel52A' }}
                center={this.state.center}
                zoom={this.state.zoom}
            >
                <AnyReactComponent
                  lat={this.state.center.lat}
                  lng={this.state.center.lng}
                  text={"!!!!!!"}
                />
        </GoogleMapReact>
    </div>
    </>
    );
  }
}
